import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Navbar as BootstrapNavbar, Nav, Container, NavDropdown, Badge } from 'react-bootstrap';
import { FaShoppingCart, FaUser } from 'react-icons/fa';

function Navbar({ onLogout }) {
  const navigate = useNavigate();
  const [cartItemsCount, setCartItemsCount] = useState(0);

  const handleLogout = () => {
    onLogout();
    navigate('/login');
  };

  return (
    <BootstrapNavbar bg="dark" variant="dark" expand="lg" className="mb-4">
      <Container>
        <BootstrapNavbar.Brand as={Link} to="/home">
          üç© Donut Shop
        </BootstrapNavbar.Brand>
        
        <BootstrapNavbar.Toggle aria-controls="basic-navbar-nav" />
        
        <BootstrapNavbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/home">Home</Nav.Link>
            
            <NavDropdown title="Shop" id="shop-dropdown">
              <NavDropdown.Item as={Link} to="/shop/donut">Donuts</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/shop/beverage">Beverages</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/shop/pizza">Pizza</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/shop/drink">Drinks</NavDropdown.Item>
            </NavDropdown>
          </Nav>
          
          <Nav>
            <Nav.Link as={Link} to="/cart" className="position-relative">
              <FaShoppingCart size={20} />
              {cartItemsCount > 0 && (
                <Badge 
                  pill 
                  bg="danger" 
                  className="position-absolute top-0 start-100 translate-middle"
                >
                  {cartItemsCount}
                </Badge>
              )}
            </Nav.Link>
            
            <NavDropdown title={<FaUser />} align="end">
              <NavDropdown.Item>Profile</NavDropdown.Item>
              <NavDropdown.Item>Orders</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item onClick={handleLogout}>
                Logout
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </BootstrapNavbar.Collapse>
      </Container>
    </BootstrapNavbar>
  );
}

export default Navbar;
